// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract MetaLifeOgPet is ReentrancyGuard, ERC721Enumerable, Ownable {

  using Counters for Counters.Counter;
  using Strings for uint256;

  // Logs
  event AddedAddressesEligible(uint256 nbWallets, uint256 countQuantities);
  event AddedAddressesGiveway(uint256 nbWallets);

  event MintedEligible(address indexed from, uint256 timestamp, uint256[] tokenIds);
  event MintedGiveway(address indexed from, uint256 timestamp, uint256 tokenId);
  event MintedAirdrop(uint256 timestamp, uint256[] tokenIds);
  event MintedDev(address indexed from, uint256 timestamp, uint256[] tokenIds);

  event RevokedAddressesGiveway(uint256 timestamp);

  // Public var
  string public baseURI;
  uint256 public maxSupply = 1500;
  address payable public collector;

  mapping(address => uint256) public addressesEligible;
  mapping(address => uint8) public addressesGiveway;
  mapping(address => uint8) public addressesAirdrop;
  address[] public listAddressesEligible;
  address[] public listAddressesGiveway;

  uint256 public mintedEligible = 0;
  uint256 public mintedGiveway = 0;
  uint256 public mintedAirdrop = 0;
  uint256 public mintedDev = 0;

  // Private var
  Counters.Counter private _tokenIds;

  constructor(string memory name_, string memory symbol_) ERC721(name_, symbol_){
  }

  function withdrawAll() public payable onlyOwner {
    collector.transfer(address(this).balance);
  }

  function setCollector(address payable _newCollector) public onlyOwner {
    collector = _newCollector;
  }

  function getMintEligible() public view returns(uint256) {
    return addressesEligible[msg.sender];
  }

  function getMintEligibleByAddress(address _wallet) public view returns(uint256) {
    return addressesEligible[_wallet];
  }

  function getMintGivewayByAddress(address _address) public view returns(uint8) {
    return addressesGiveway[_address];
  }

  function _setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }

  function _restMintEligible() public view returns (uint256) {
    uint256 restToMint = 0;
    for (uint i = 0; i < listAddressesEligible.length; i++) {
      restToMint += addressesEligible[listAddressesEligible[i]];
    }
    return restToMint;
  }

  function _restMintGiveway() public view returns (uint256) {
    uint256 restToMint = 0;
    for (uint i = 0; i < listAddressesGiveway.length; i++) {
      restToMint += addressesGiveway[listAddressesGiveway[i]];
    }
    return restToMint;
  }

  function _restMint() public view returns (uint256) {
    return _restMintEligible() + _restMintGiveway();
  }

  function _sumQuantities(uint256[] calldata _quantities) public pure returns (uint256) {
    uint256 sum = 0;
    for (uint i = 0; i < _quantities.length; i++) {
      sum += _quantities[i];
    }
    return sum;
  }

  function addAddressesEligible(address[] calldata _toAddAddresses, uint256[] calldata _quantities) external onlyOwner {
    require(_toAddAddresses.length == _quantities.length, "Count addresses and count quantities must be equal");
    require(totalSupply() + _restMint() + _sumQuantities(_quantities) <= maxSupply, "Not enough tokens left");
    for (uint i = 0; i < _toAddAddresses.length; i++) {
      addressesEligible[_toAddAddresses[i]] = _quantities[i];
      listAddressesEligible.push(_toAddAddresses[i]);
    }
    emit AddedAddressesEligible(_toAddAddresses.length, _quantities.length);
  }

  function revokeAddressesGiveway() external onlyOwner {
    for (uint i = 0; i < listAddressesGiveway.length; i++) {
      addressesGiveway[listAddressesGiveway[i]] = 0;
    }
    delete listAddressesGiveway;
    emit RevokedAddressesGiveway(block.timestamp);
  }

  function _mint(address _to) internal returns (uint256) {
    _tokenIds.increment();
    uint256 _tokenId = _tokenIds.current();
    _safeMint(_to, _tokenId);
    return _tokenId;
  }

  function mintEligible(uint256 _nb) external payable {
    require(totalSupply() + _nb <= maxSupply, "Not enough tokens left");
    require(addressesEligible[msg.sender] > 0, "Not eligible");
    require(addressesEligible[msg.sender] >= _nb, "Not enough claimable tokens");

    uint256[] memory _tokenIdsMinted = new uint256[](_nb);
    for (uint32 i = 0; i < _nb; i++) {
      addressesEligible[msg.sender]--;
      mintedEligible++;
      _tokenIdsMinted[i] = _mint(msg.sender);
    }
    emit MintedEligible(msg.sender, block.timestamp, _tokenIdsMinted);
  }

  function mintDev(uint256 _nb) external onlyOwner {
    require(totalSupply() + _restMint() + _nb <= maxSupply, "Not enough tokens left");

    uint256[] memory _tokenIdsMinted = new uint256[](_nb);
    for (uint32 i = 0; i < _nb; i++) {
      mintedDev++;
      _tokenIdsMinted[i] = _mint(msg.sender);
    }
    emit MintedDev(msg.sender, block.timestamp, _tokenIdsMinted);
  }

  function addAddressesGiveway(address[] calldata _toAddAddresses) external onlyOwner {
    require(totalSupply() + _restMint() + _toAddAddresses.length <= maxSupply, "Not enough tokens left");
    for (uint i = 0; i < _toAddAddresses.length; i++) {
      addressesGiveway[_toAddAddresses[i]]++;
      listAddressesGiveway.push(_toAddAddresses[i]);
    }
    emit AddedAddressesGiveway(_toAddAddresses.length);
  }

  function mintGiveway() external payable {
    require(addressesGiveway[msg.sender] > 0, "No giveway");

    addressesGiveway[msg.sender] = 0;
    mintedGiveway++;
    uint256 _tokenIdMinted = _mint(msg.sender);

    emit MintedGiveway(msg.sender, block.timestamp, _tokenIdMinted);
  }

  function mintAirdrop(address[] calldata _toAirdropAddresses) external onlyOwner {
    require(totalSupply() + _restMint() + _toAirdropAddresses.length <= maxSupply, "Not enough tokens left");

    uint256[] memory _tokenIdsMinted = new uint256[](_toAirdropAddresses.length);
    for (uint i = 0; i < _toAirdropAddresses.length; i++) {
      mintedAirdrop++;
      _tokenIdsMinted[i] = _mint(_toAirdropAddresses[i]);
    }

    emit MintedAirdrop(block.timestamp, _tokenIdsMinted);
  }
}
